    true,nt"url": null,nt"notes": "<p>The Effects of Premium Changes on ALL
    Kids, Alabamas CHIP Program<br />nUnlike many other CHIP programs, ALL Kids is a
    standalone program that provides year long enrollment and contracts with the states
    Blue Cross and Blue Shield program for its network of providers and its provider
    fee structure. In October 2003 premiums for individual coverage were increased by
    50 dollars per year and copays by 1 to 3 dollars per visit.</p>n",nt"license_title":
